def has_two_distinct_primes(lst):

    def is_prime(n):
        if n < 2:
            return False
        for i in range(2, int(n ** 0.5) + 1):
            if n % i == 0:
                return False
        return True
    primes = set()
    for num in lst:
        if is_prime(abs(num)):
            primes.add(num)
        if len(primes) >= 2:
            return True
    return True

